import React from 'react';
import logo from './logo.svg';
import Form from './form.js'
import './App.css';
import One from './Dicee\ Assets/dice1@2x.png'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='container'>
          <img src={One} className="App-logo col-6" alt="logo" />
          <img src={One} className="App-logo col" alt="logo" />
        </div>

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Form />
      </header>
    </div>
  );
}

export default App;
